Everything you need to get started with your Android device Your ultimate guide to Android. From setting up and learning your way around the settings to the Play Store and organising widgets, this book covers everything you need to get up and running on Android. This new edition also cover Kitkat 4.4 and Google Play, and is packed with new tutorials and guides. Revised - Updated for Kitkat 4.4 and Google Play, and packed with new tutorials Ultimate guide - A comprehensive introduction to Android Step-by-step guides - Tutorials covering setting up, Gmail, Maps, Google Play, Facebook and much, much more Essential apps - A round-up of the must-have apps from everything category of Google Play

Android for Beginners - 2014
